import "./navBar.css"
import React from "react";
import {Link} from 'react-router-dom';

export default function NavBar() {

    return (
        <div className="navBar">
            <Link to='/vision'>Vision</Link>
            <Link to='/book_spaces'>Book Space</Link>
            <Link to='/services'>Services</Link>
        </div>
    )

}
